import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import "bootstrap";
import Auth from "./views/Auth";
import AuthContextProvider from "./contexts/AuthContext";
import Dashboard from "./views/Dashboard";
import ProtectedRoute from "./components/routing/ProtectedRoute";
import About from "./views/About";
import Device from "./views/Device";
import Statistics from "./views/Statistics";
import DataContextProvider from "./contexts/DataContext";
import StatusContextProvider from "./contexts/StatusContext";
import TypeContextProvider from "./contexts/TypeContext";
import TotalVolumeContextProvider from "./contexts/TotalVolumeContext";
import Setting from "./views/Setting";
import ConfigContextProvider from "./contexts/ConfigContext";
function App() {
  return (
    <AuthContextProvider>
      <DataContextProvider>
        <ConfigContextProvider>
          <TypeContextProvider>
            <StatusContextProvider>
              <TotalVolumeContextProvider>
                <Router>
                  <Switch>
                    <Route exact path="/" component={About} />
                    <Route
                      exact
                      path="/login"
                      render={(props) => <Auth {...props} authRoute="login" />}
                    />
                    <Route
                      exact
                      path="/register"
                      render={(props) => (
                        <Auth {...props} authRoute="register" />
                      )}
                    />
                    <ProtectedRoute
                      exact
                      path="/dashboard"
                      component={Dashboard}
                    />
                    <ProtectedRoute exact path="/setting" component={Setting} />
                    <ProtectedRoute exact path="/device" component={Device} />
                    <ProtectedRoute
                      exact
                      path="/statistics"
                      component={Statistics}
                    />
                  </Switch>
                </Router>
              </TotalVolumeContextProvider>
            </StatusContextProvider>
          </TypeContextProvider>
        </ConfigContextProvider>
      </DataContextProvider>
    </AuthContextProvider>
  );
}

export default App;
